import './Summary.css'
import React, { useState, useEffect } from 'react';
import SummaryInnings from './SummaryInnings';
import SummaryFooter from './SummaryFooter';
import SummaryHeader from './SummaryHeader';

function Summary(props) {

    // let temp1 = "http://localhost:8000/match/"
    // let temp2 = "1"
    // let temp3 = "/summary"
    // let link = temp1 + temp2 + temp3
    // console.log(link)
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
        const response = await fetch('http://localhost:8000/match/97/summary');
        const jsonData = await response.json();
        setData(jsonData);
        };

        fetchData();
    }, []);

    console.log(data)
    if (!data) {
        return <div>Loading...</div>;
      }
    return (
        <div className="summary">
            <SummaryHeader header={data.header}/>
            <SummaryInnings inn={data.inn1} tour={data.tour}/>
            <SummaryInnings inn={data.inn2} tour={data.tour}/>
            <SummaryFooter/>

        </div>
    )

    }
export default Summary;
